import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  let fs = require('fs');
  let csv = require('csv'); 

  fs.readFile("6th_eidition_skills.csv", "utf-8", (err, data) => {
    if (err) throw err;
    console.log(data);
  });


  console.log(fs);

  return (
    <div className="App">
      <h2>キャラクターシート</h2>
    </div>
  );
}

export default App;
